'''Narbeleth''' means "sun-waning" and was an alternative name for the [[Sindarin]] season of [[Firith]], or late autumn. It was also the Sindarin name for the tenth month of the year in the [[King's Reckoning]] and [[Stewards' Reckoning]] calendars, and the seventh month of the year in the [[New Reckoning]].<ref>{{App|Calendars}}</ref>

